import React, { Component } from 'react';
import './App.css';


class TodoForm extends Component {
    constructor(props) {
        super(props),
            this.state = { inputValue: 'loha' }
    }

    render() {
        return (
            <div>
                <input
                    type="text"
                    value={this.setState.inputValue}
                
                />
                <button>Add Todo</button>
            </div >
        );
    }
}

export default TodoForm;
